export const statusColorClass = (status) => {
    switch(status) {
        case 'ACCEPTED':
          return 'accepted';
        case 'PENDING':
          return 'pending';
        case 'NEW':
            return 'new';
        case 'CLOSED':
            return 'closed';
        default:
          return 'new';
      }
}
